calcolato in saccarosio) o d'isoglucosio calcolato in saccarosio, uguale o
superiore a 70 % &nbsp;

Concentrato di succo di mirtilli rossi:

- di un valore Brix pari o superiore a 40 e inferiore o uguale a 66,

- in imballaggi immediati di contenuto netto di 50 litri o più &nbsp;

Concentrato congelato di succo di acerola:

- con un valore Brix compreso tra 48 e 67,

- in imballaggi immediati aventi un contenuto netto di almeno 50 litri &nbsp;

Idrolizzato di proteine della caseina contenente:

- in peso almeno 20 %, ma non più di 70 % di aminoacidi liberi e

- peptoni di cui, in peso, più di 90 % con massa molecolare inferiore o uguale a 2 000 Da &nbsp;

Corindone sinterizzato, con struttura microcristallina, composto da ossido di alluminio (CAS RN 1344-28-1) e alluminato di magnesio (CAS RN 12068-51-8), contenente in peso (ogni elemento calcolato come ossido):

-tra 92 % e 94 % di ossido di alluminio, e

-7 % (± 1 %) di ossido di magnesio &nbsp;

Diossido di titanio (CAS RN 13463-67-7):

- di purezza in peso, del 99,9 % o più,

- di granulometria media compresa fra 0,7 µm e 2,1 µm &nbsp;

Idrossido di calcio, di purezza, in peso, di 98 % o più sul prodotto secco, sotto forma di particelle di cui:
- non più di 1 %, in peso, ha un diametro superiore a 75 micrometri, e
- non più di 4 %, in peso, ha un diametro inferiore a 1,3 micrometri &nbsp;

Sodio tungstato (CAS RN 13472-45-2) con:

-purezza, in peso, di 99 % o più,

-tenore di cloro inferiore a 100 ppm &nbsp;
